        pointer-events: none;

        pointer-events: none;
    }

        stroke: #7f7f7f;
        fill: #bfbfbf;
        pointer-events: none;
    }

        fill: #007aff;
    }

    .map-groups-techs g g path:nth-child(2) {
        fill: #fff;
    }

    .map-groups-wcs g polyline {
        stroke: #7f7f7f;
        fill: #ac7ab6;
        pointer-events: none;
    }

    .map-groups-wcs g path:nth-child(1) {
        fill: #007aff;
    }

    .map-groups-wcs g path:nth-child(2) {
        fill: #fff;
    }

        stroke: #7f7f7f;
        fill: #bfbfbf;
        pointer-events: none;
    }

        fill: #009245;
    }

    .map-groups-escapes g g path:nth-child(2) {
        fill: #fff;

    .room-map-group-search-target line,

    .label {

        color: #7f7f7f !important;
        stroke-width: 0.1 !important
